query:
/*+ NoHashJoin(t mc) NoMergeJoin(mc t ci) */ select count(*)
from title AS t
inner join movie_companies AS mc
on t.id = mc.movie_id AND t.production_year < 2010 AND mc.company_id = 420 AND mc.company_type_id = 1
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id < 531802 AND ci.role_id = 1;
